import React from 'react';
import { makeStyles } from '@material-ui/styles';
import './App.css';
import { Menu } from './components/Menu';

const useStyles = makeStyles(theme => ({
  root: {flexGrow: 1}
}))

function App() {

  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Menu />
    </div>
  );
}

export default App;
